import React from "react";
import "./style.css";

function SaveButton ({saveButtonClick, id, key}) {

    return (


        <button data-id={id} onClick={(key) => {saveButtonClick(key)}} className="btn btn-info save-btn">Save</button>

    )

}

export default SaveButton;
